in_source: |-
  RESULT: VAR 0
  I: VAR 0
  MAX: VAR 1000
  START: LD (I)
  MOD 3
  JZ INC_AND_NEXT
  LD (I)
  MOD 5
  JZ INC_AND_NEXT
  JMP NEXT
  INC_AND_NEXT: LD (RESULT)
  ADD (I)
  ST RESULT
  NEXT: LD (I)
  ADD 1
  ST I
  CMP (MAX)
  JZ PREPARE_STR
  JMP START
  PREPARE_STR: LD (RESULT)
  MOD 10
  ADD '0'
  ST (RESULT_STR)
  LD (RESULT_STR)
  ADD 1
  ST RESULT_STR
  LD (RESULT)
  DIV 10
  ST RESULT
  CMP 0
  JZ PRINT
  JMP PREPARE_STR
  PRINT: LD (RESULT_STR)
  SUB 1
  ST RESULT_STR
  LD [RESULT_STR]
  ST 2047
  LD (RESULT_STR)
  CMP 500
  JZ STOP
  JMP PRINT
  STOP: HLT
  RESULT_STR: VAR 500
in_stdin: ''
